import './App.css';
import React from 'react';

import {Footer,Blog,Possibility,Features,Whatperiod,Header} from './container';
import {Cta,Brand,Navbar} from './component';



function App() {
  return (
    <div className="App">
      <div className="gradient__bg">
        <Navbar />
        <Header />
      </div>
      <Whatperiod />
      <Features />
      <Possibility />
      <Cta />
      <Blog />
      <Footer />
    </div>
  );
}

export default App;
